import React from 'react';
import Graph from './components/Graph';
import './App.css';
import Nav from './components/Nav';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
    <Nav />
    <Graph />
    </div>
    </Router>
  );
}

export default App;
